pub enum Signal { /// Reset the pipeline. Reset(ResetSignal), /// Hardfork Activation. Activation(ActivationSignal), /// Flush the currently active channel. FlushChannel, /// Updates the rollup config in the IndexedTraversal or PollingTraversal stage. UpdateConfig(ConfigUpdateSignal),
