The kona-node is designed as a modular, actor-based node SDK, making it possible to extend or customize node behavior by adding new actors or swapping out existing ones. This extensibility is currently in beta , but the architecture is intentionally built to support advanced use cases and custom integrations. Actor Model At the core of kona-node is the concept of actors —independent, async services that communicate via channels. Each actor implements the NodeActor trait, which defines how the actor is built, started, and how it communicates with other actors. Key built-in actors include: EngineActor : Manages the execution layer (EL) Engine API. DerivationActor : Runs the derivation pipeline to produce L2 payloads. NetworkActor : Handles P2P networking and block gossip. RpcActor : Runs the node's RPC server. SupervisorActor : Integrates with the supervisor RPC API. RuntimeActor : Loads and manages runtime configuration. L1WatcherRpc : Watches L1 for new blocks and events. Extending with Custom Actors You can add your own actors to the node by implementing the NodeActor trait. This allows you to introduce new background services, event processors, or integrations with external systems. Example: Defining a Custom Actor use kona_node_service::NodeActor;
