} Integrating Custom Actors To integrate your custom actor, you can create your own implementation of the RollupNodeService trait, which defines the set of actors and pipelines used by the node. You can swap out any of the built-in actors for your own, or add entirely new ones. Example: Custom RollupNodeService use kona_node_service::{RollupNodeService, NodeActor, ...}; struct MyNodeService; #[async_trait]
impl RollupNodeService for MyNodeService { // Use built-in actors, or your own custom ones type DataAvailabilityWatcher = MyCustomActor; type DerivationPipeline = ...; type DerivationActor = ...; type EngineActor = ...; type NetworkActor = ...; type SupervisorExt = ...; type SupervisorActor = ...; type RuntimeActor = ...; type RpcActor = ...; type Error = ...; // Implement required trait methods...
} You can then instantiate and run your custom node service in your own binary or integration test. Programmatic Node Construction The RollupNodeBuilder provides a convenient way to construct a standard node, but for advanced use cases, you can build your own node by composing actors and services directly, or by implementing your own builder pattern. Current Limitations The extensibility API is beta and may change. Most users will want to start by subclassing or wrapping the standard RollupNode and only override specific actors or pipelines as needed. Documentation and examples for advanced extensibility are still evolving—contributions and feedback are welcome! Learn More See the NodeActor trait documentation for details on implementing actors. Explore the kona-node-service crate for source code and more examples.

